configs.apply:
({isProcess, apis, config, addHierarchy}) => {
      if (isProcess) {
        const api = apis('properties')
        api.createActionPrefix({
          before: [{tag: 'maker', id: 'maker'}],
          operator: 'make',
          after: [{tag: 'makeable', id: 'makeable'}],
          relation: true,
          flatten: true,
          create: [
            {
              id: 'make',
              infinitive: 'make',
              isA: ['canableAction'],
            },
            'makeable', 
            'maker'
          ],
          localHierarchy: [
            ['unknown', 'maker'],
            ['unknown', 'makeable'],
          ],
          config,
        })
      }
    }

